import React from 'react';
import './Stylecontact.css';
import img from './ewallet.png'
import { ClassNames } from '@emotion/react';

const Contactus = () => {
    return(
        <>
        <div className="row">
            <div>
        <img className='wallet' src={img} alt='..'/>

            </div>
        </div>
       
        </>
    )
 
}

  
export default Contactus;
